import React from 'react';

import styles from './ChatBaloon.module.css';

function ChatBaloon(props) {
    return (
        <img className={styles['chat-baloon']} alt="Chat-Baloon" src="https://media-exp1.licdn.com/dms/image/C4E03AQGji9lWkNw1yg/profile-displayphoto-shrink_800_800/0/1600437083110?e=1625702400&v=beta&t=xG7SRFFPzw8q7kGLRSI6KVU9S4i4U0LZxIaM0h0nS78"></img>
    );
}

export default ChatBaloon;
